import{_ as d,c as i,o as n,j as t,a as e,aj as r,J as l,ak as h}from"./chunks/framework.DRmbE9yB.js";const c={};function u(s,a){return n(),i("table",null,[...a[0]||(a[0]=[t("tbody",null,[t("tr",null,[t("th",null," Field Value "),t("td",null,[t("ul",null,[t("li",null,[e("if field value is "),t("strong",null,"empty"),e(" then close active tab.")]),t("li",null,[e("if field value is "),t("strong",null,"false"),e(" then skip close tab action.")]),t("li",null,[e("You can also set the "),t("strong",null,"Tab Id"),e(" in the field value.")])])])])],-1)])])}const b=d(c,[["render",u]]),g={};function f(s,a){return n(),i("table",null,[...a[0]||(a[0]=[t("tbody",null,[t("tr",null,[t("th",null," Field Value "),t("td",null,[t("ul",null,[t("li",null,[e("File Name: "),t("strong",null,"fileName")]),t("li",null,[e("File Name with Folder: "),t("strong",null,"foldername\\fileName")]),t("li",null,[e("Variable with Folder: "),t("strong",null,"foldername\\{$predefine_variable$}")]),t("li",null,[e("⚠️ You do not have to give the full path of the folder "),t("strong",null,"(D:\\Excel)"),e(", you can only give the name of any folder in the "),t("strong",null,"Download Folder"),e(" of the PC.")])])])]),t("tr",{style:{"background-color":"var(--vp-c-bg) !important"}},[t("th",null," Ways to save the file? "),t("td",null,[t("ul",null,[t("li",null,[t("strong",null,"Uniquify"),e(" : If you want to save the file with a unique name")]),t("li",null,[t("strong",null,"Overwrite"),e(" : If you want to overwrite the file")])])])])],-1)])])}const p=d(g,[["render",f]]),y=JSON.parse('{"title":"Browser Action","description":"","frontmatter":{},"headers":[],"relativePath":"documentation/field-types/browser-actions.md","filePath":"documentation/field-types/browser-actions.md","lastUpdated":1758109585000}'),m={name:"documentation/field-types/browser-actions.md"},v=Object.assign(m,{setup(s){return(a,o)=>(n(),i("div",null,[o[0]||(o[0]=r('<h1 id="browser-action" tabindex="-1">Browser Action <a class="header-anchor" href="#browser-action" aria-label="Permalink to “Browser Action”">​</a></h1><p>The <strong>Browser Action</strong> field types allow you to automate and control various browser tab operations within your project. These field types enable you to open new tabs, retrieve tab IDs, capture screenshots, update tab properties, close tabs, and perform other browser-related actions.</p><h2 id="open-a-new-tab" tabindex="-1">Open a new Tab <a class="header-anchor" href="#open-a-new-tab" aria-label="Permalink to “Open a new Tab”">​</a></h2><p>Open a new tab in browser then use this field type and you can set tab <code>url</code> in the <code>field value</code> or <code>default value</code>.</p><hr><h2 id="get-tab-id" tabindex="-1">Get Tab ID <a class="header-anchor" href="#get-tab-id" aria-label="Permalink to “Get Tab ID”">​</a></h2><p>This field type retrieves the ID of a specific tab within the browser. It allows you to identify the desired tab using various matching methods.</p><table tabindex="0"><thead><tr><th>Options</th><th>Description</th></tr></thead><tbody><tr><td><strong>Which type of match you want to use?</strong></td><td>Choose the matching method for identifying the tab:</td></tr><tr><td></td><td>- <strong>By Tab URL and Title:</strong> Match using both URL and title criteria</td></tr><tr><td></td><td>- <strong>By Tab Index:</strong> Match using the tab&#39;s position index</td></tr><tr><td></td><td>- <strong>Active Tab:</strong> Target the currently active tab</td></tr><tr><td><strong>Tab Index</strong></td><td>Specify the tab&#39;s position index (only used when &quot;By Tab Index&quot; is selected).</td></tr><tr><td><strong>Which URL match pattern you want to use?</strong></td><td>Choose the URL matching pattern:</td></tr><tr><td></td><td>- <strong>Default Browser Match Patterns:</strong> Use Chrome extension match patterns, <a href="https://developer.chrome.com/docs/extensions/develop/concepts/match-patterns" target="_blank" rel="noreferrer">More Details</a></td></tr><tr><td></td><td>- <strong>Use with Regex:</strong> Use regular expressions with (:any), (:any(:end)) for dynamic matching <a href="/documentation/form/form.html#regex-matching-examples">More Details</a></td></tr><tr><td><strong>Tab URL</strong></td><td>Specify the URL of the tab you want to identify.</td></tr><tr><td><strong>Should we use tab title for matching?</strong></td><td>Enable this option to include tab title in the matching criteria.</td></tr><tr><td><strong>Wait until the tab url or title matches?</strong></td><td>Enable this option to make the field wait until the specified tab URL or title is found.</td></tr><tr><td><strong>Should we use timeout (Set in Minutes)?</strong></td><td>Set a maximum time limit (in minutes) to wait for the tab to be found.</td></tr></tbody></table><p><strong>Usage:</strong></p><p>The field&#39;s value will be the ID of the identified tab. You can use this ID in other browser actions, such as <code>Focus Tab</code>, <code>Close Browser Tab</code>, or <code>Reload Tab</code>.</p><div class="info custom-block"><p class="custom-block-title">Note</p><ul><li>If multiple tabs match the specified criteria, the ID of the first matching tab will be returned.</li><li>If no tab matches within the timeout limit, the field&#39;s value will be <code>null</code>.</li></ul></div><hr><h2 id="get-tab-details" tabindex="-1">Get Tab Details <a class="header-anchor" href="#get-tab-details" aria-label="Permalink to “Get Tab Details”">​</a></h2><p>This field type retrieves specific details about a browser tab. It allows you to extract various tab properties such as URL, title, favicon, index, and other tab attributes.</p><table tabindex="0"><thead><tr><th>Options</th><th>Description</th></tr></thead><tbody><tr><td><strong>Which type of details you want to get?</strong></td><td>Choose the specific tab property you want to retrieve:</td></tr><tr><td></td><td>- <strong>Get Tab URL:</strong> Retrieve the URL of the specified tab</td></tr><tr><td></td><td>- <strong>Get Tab Title:</strong> Retrieve the title of the specified tab</td></tr><tr><td></td><td>- <strong>Get Tab Favicon URL:</strong> Retrieve the favicon URL of the specified tab</td></tr><tr><td></td><td>- <strong>Get Tab Index:</strong> Retrieve the position index of the specified tab</td></tr><tr><td></td><td>- <strong>Get Tab windowId:</strong> Retrieve the window ID that contains the specified tab</td></tr><tr><td></td><td>- <strong>Get Tab Active?:</strong> Check if the specified tab is currently active (returns true/false)</td></tr><tr><td></td><td>- <strong>Get Tab Incognito?:</strong> Check if the specified tab is in incognito mode (returns true/false)</td></tr><tr><td></td><td>- <strong>Get Tab Pinned?:</strong> Check if the specified tab is pinned (returns true/false)</td></tr><tr><td><strong>Tab Id</strong></td><td>Enter the ID of the tab from which the data is to be extracted in the default value settings of the field.</td></tr></tbody></table><p><strong>Usage:</strong></p><p>The field&#39;s value will contain the requested tab detail based on your selection. You can use this data in other fields like <a href="#download-item">Download Item</a> or for conditional logic in your automation flow.</p><div class="info custom-block"><p class="custom-block-title">Note</p><ul><li>If the specified tab ID is invalid or the tab no longer exists, the field&#39;s value will be <code>null</code>.</li><li>The tab ID can be obtained using the &quot;Get Tab ID&quot; field type.</li></ul></div><hr><h2 id="capture-tab" tabindex="-1">Capture Tab <a class="header-anchor" href="#capture-tab" aria-label="Permalink to “Capture Tab”">​</a></h2><p>If you want to take a screenshot of the page then you can use this.</p><div class="info custom-block"><p class="custom-block-title custom-block-title-default">INFO</p><p>Will capture the <code>entire page</code> if you are using <code>Firefox</code> browser.</p></div><h2 id="update-tab" tabindex="-1">Update Tab <a class="header-anchor" href="#update-tab" aria-label="Permalink to “Update Tab”">​</a></h2><p>Action on Active Tab.</p><ul><li><code>active</code></li><li><code>autoDiscardable</code></li><li><code>highlighted</code></li><li><code>muted</code></li><li><code>pinned</code></li><li><code>url</code></li></ul><h2 id="go-back-to-previous-page" tabindex="-1">Go Back to Previous Page <a class="header-anchor" href="#go-back-to-previous-page" aria-label="Permalink to “Go Back to Previous Page”">​</a></h2><p>if <code>element value</code> is <code>false</code> then skip this action (also set tab id in the <code>element value</code>)</p><h2 id="go-forward-to-next-page" tabindex="-1">Go Forward to Next Page <a class="header-anchor" href="#go-forward-to-next-page" aria-label="Permalink to “Go Forward to Next Page”">​</a></h2><p>if <code>element value</code> is <code>false</code> then skip this action (also set tab id in the <code>element value</code>)</p><h2 id="check-downloads" tabindex="-1">Check Downloads <a class="header-anchor" href="#check-downloads" aria-label="Permalink to “Check Downloads”">​</a></h2><p>Monitor and verify download status in the browser&#39;s download list with support for filename pattern matching and custom filtering.</p><p><a href="/documentation/field-types/browser-actions/check-downloads.html">More Details</a></p><hr><h2 id="reload-tab" tabindex="-1">Reload Tab <a class="header-anchor" href="#reload-tab" aria-label="Permalink to “Reload Tab”">​</a></h2><p>if <code>element value</code> is <code>false</code> then skip this action (also set tab id in the <code>element value</code>)</p><h2 id="focus-tab" tabindex="-1">Focus Tab <a class="header-anchor" href="#focus-tab" aria-label="Permalink to “Focus Tab”">​</a></h2><p>It is used to focus the browser&#39;s <em>tab</em>.</p><table tabindex="0"><thead><tr><th>Options</th><th>Description</th><th>Required</th></tr></thead><tbody><tr><td><strong>Field Value</strong></td><td><strong>-</strong> If field value is <strong>empty</strong> then focus active tab.<br><strong>-</strong> If field value is <strong>false</strong> then skip focus tab action.<br><strong>-</strong> You can also set the <strong>Tab Id</strong> in the field value.</td><td>No</td></tr></tbody></table><h2 id="focus-window" tabindex="-1">Focus Window <a class="header-anchor" href="#focus-window" aria-label="Permalink to “Focus Window”">​</a></h2><p>It is used to focus the browser&#39;s <em>window</em>.</p><table tabindex="0"><thead><tr><th>Options</th><th>Description</th><th>Required</th></tr></thead><tbody><tr><td><strong>Field Value</strong></td><td><strong>-</strong> If field value is <strong>empty</strong> then focus active window.<br><strong>-</strong> If field value is <strong>false</strong> then skip focus window action.<br><strong>-</strong> You can also set the <strong>Window Id</strong> in the field value.</td><td>No</td></tr></tbody></table><h2 id="close-browser-tab" tabindex="-1">Close Browser Tab <a class="header-anchor" href="#close-browser-tab" aria-label="Permalink to “Close Browser Tab”">​</a></h2><p>This field type can be used to <strong>close</strong> the browser <strong>Tab</strong>.</p><table tabindex="0"><thead><tr><th>Options</th><th>Description</th></tr></thead><tbody><tr><td><strong>Match the tab with the tab title and tab URL and then close it?</strong></td><td>Enable this option to match and close a tab based on URL and title criteria.</td></tr><tr><td><strong>Tab URL</strong></td><td>Specify the URL of the tab you want to close.</td></tr><tr><td><strong>Tab Title</strong></td><td>Specify the title of the tab you want to close.</td></tr><tr><td><strong>Timeout</strong></td><td>Set a maximum time limit (in minutes) to wait for the tab to be found.</td></tr><tr><td><strong>Wait until the tab url or title matches?</strong></td><td>Enable this option to make the field wait until the specified tab URL or title is found before closing.</td></tr><tr><td><strong>Close the active tab only?</strong></td><td>Enable this option to close only the currently active tab.</td></tr></tbody></table>',44)),l(b),o[1]||(o[1]=r('<div class="tip custom-block"><p class="custom-block-title">NOTE</p><p>Whichever tab you want to close, enter Tab id in the field default value. If no Tab ID is given then that tab will be closed in which form this field is present.</p></div><h2 id="close-browser-window" tabindex="-1">Close Browser Window <a class="header-anchor" href="#close-browser-window" aria-label="Permalink to “Close Browser Window”">​</a></h2><p>This field type can be used to <strong>close</strong> the browser <strong>Window</strong>.</p><table tabindex="0"><thead><tr><th>Options</th><th>Description</th><th>Required</th></tr></thead><tbody><tr><td><strong>Field Value</strong></td><td><strong>-</strong> If field value is <strong>empty</strong> then close active window.<br><strong>-</strong> If field value is <strong>false</strong> then skip close window action.<br><strong>-</strong> You can also set the <strong>Window Id</strong> in the field value.</td><td>No</td></tr></tbody></table><h2 id="set-download-item-file-name" tabindex="-1">Set Download Item File Name <a class="header-anchor" href="#set-download-item-file-name" aria-label="Permalink to “Set Download Item File Name”">​</a></h2><p>If you want to change the name of the file being downloaded in the browser, then use it before clicking on the download button.</p>',6)),l(p),o[2]||(o[2]=r('<div class="warning custom-block"><p class="custom-block-title custom-block-title-default">WARNING</p><p>This field type only uses single file rename at a time, does not work on multiple tabs and multiple files.</p></div><h2 id="download-item" tabindex="-1">Download Item <a class="header-anchor" href="#download-item" aria-label="Permalink to “Download Item”">​</a></h2><p>This field type allows you to download files from URLs with various download options and file handling preferences.</p><table tabindex="0"><thead><tr><th>Options</th><th>Description</th></tr></thead><tbody><tr><td><strong>Which type of downloader you want to use?</strong></td><td>Choose the download method:</td></tr><tr><td></td><td>- <strong>Use Chrome Downloader:</strong> Use the browser&#39;s built-in download functionality</td></tr><tr><td></td><td>- <strong>Use Download Yourself:</strong> Handle the download process manually</td></tr><tr><td><strong>What to do if the file already exists?</strong></td><td>Choose how to handle existing files:</td></tr><tr><td></td><td>- <strong>Uniquify:</strong> Add a unique identifier to the filename to avoid conflicts</td></tr><tr><td></td><td>- <strong>Replace:</strong> Overwrite the existing file</td></tr><tr><td></td><td>- <strong>Prompt for User:</strong> Ask the user to choose what to do</td></tr><tr><td><strong>Use a file-chooser to allow the user to choose a filename?</strong></td><td>Enable this option to show a file dialog for the user to select the download location and filename.</td></tr><tr><td><strong>Set the file name</strong></td><td>Specify the desired filename for the downloaded file.</td></tr><tr><td><strong>File URL</strong></td><td>Enter the URL of the item to be downloaded in the default value settings of the field.</td></tr></tbody></table><p><strong>Usage:</strong></p><p>This field type initiates a download process for the specified URL. The download behavior depends on your selected options for downloader type, file conflict handling, and filename settings.</p><div class="info custom-block"><p class="custom-block-title">Note</p><ul><li>The File URL should be a direct download link to the file you want to download.</li><li>If using &quot;Use Download Yourself&quot;, ensure the URL is accessible and the file is downloadable.</li><li>File conflict resolution options help manage scenarios where files with the same name already exist.</li></ul></div><div class="info custom-block"><p class="custom-block-title">Important</p><p>You must <code>Allow</code> the site permission <code>Automatic downloads</code> for this field type to work.</p><img src="'+h+'" alt="Download Item"><p><strong>How to open site permission?</strong></p><p>chrome://settings/content/siteDetails?site=(YOUR_SITE_URL)</p></div><hr><h2 id="insert-css" tabindex="-1">Insert CSS <a class="header-anchor" href="#insert-css" aria-label="Permalink to “Insert CSS”">​</a></h2><p>Inserts a CSS stylesheet into page. You can set css in the <code>field value</code> or <code>default value</code>.</p><h2 id="set-local-data" tabindex="-1">Set Local Data <a class="header-anchor" href="#set-local-data" aria-label="Permalink to “Set Local Data”">​</a></h2><p>Store data in the browser&#39;s extension storage using the <code>chrome.storage.local</code> API. The data is stored with a <strong>unique key</strong> and can be retrieved or removed later using <a href="#get-local-data">Get Local Data</a> or <a href="#remove-local-data">Remove Local Data</a>.</p><table tabindex="0"><thead><tr><th>Options</th><th>Description</th></tr></thead><tbody><tr><td><strong>Store Key Name</strong></td><td>Enter the unique key name to store the data. Use prefix <code>CTH_EDF_DB_LOCAL_</code> for consistency.</td></tr><tr><td><strong>Data Value</strong></td><td>Enter the data you want to store in the browser storage.</td></tr></tbody></table><h3 id="usage" tabindex="-1">Usage <a class="header-anchor" href="#usage" aria-label="Permalink to “Usage”">​</a></h3><ol><li><strong>Set Store Key Name</strong>: Enter a unique key name with the recommended prefix <code>CTH_EDF_DB_LOCAL_</code></li><li><strong>Set Data Value</strong>: Enter the data you want to store (text, variables, etc.)</li><li><strong>Store Data</strong>: The data will be stored in browser extension storage and can be retrieved later</li></ol><h3 id="example" tabindex="-1">Example <a class="header-anchor" href="#example" aria-label="Permalink to “Example”">​</a></h3><ul><li><strong>Store Key Name</strong>: <code>CTH_EDF_DB_LOCAL_user_email</code></li><li><strong>Data Value</strong>: <code>john@example.com</code></li></ul><h3 id="technical-notes" tabindex="-1">Technical Notes <a class="header-anchor" href="#technical-notes" aria-label="Permalink to “Technical Notes”">​</a></h3><ul><li><strong>Storage API</strong>: Uses <code>chrome.storage.local</code> API (not <code>localStorage</code>)</li><li><strong>Persistence</strong>: Data persists across browser sessions</li><li><strong>Scope</strong>: Data is accessible across all pages where the extension is active</li><li><strong>Storage Limit</strong>: Chrome extension storage typically allows up to 10MB</li><li><strong>Synchronous Access</strong>: Data retrieval is asynchronous</li></ul><hr><h2 id="get-local-data" tabindex="-1">Get Local Data <a class="header-anchor" href="#get-local-data" aria-label="Permalink to “Get Local Data”">​</a></h2><p>Retrieve data from the browser&#39;s extension storage (stored via <a href="#set-local-data">Set Local Data</a>) using the <code>chrome.storage.local</code> API and the <strong>unique key</strong> of that data.</p><table tabindex="0"><thead><tr><th>Options</th><th>Description</th></tr></thead><tbody><tr><td><strong>Store Key Name</strong></td><td>Enter the unique key name to fetch the stored data. Use prefix <code>CTH_EDF_DB_LOCAL_</code> for consistency.</td></tr><tr><td><strong>Wait until the given key data is received</strong></td><td>Enable this option to wait until the specified key data is available before proceeding.</td></tr><tr><td><strong>Delete the data after getting the key data</strong></td><td>Enable this option to automatically delete the data after retrieving it (one-time use).</td></tr></tbody></table><h3 id="usage-1" tabindex="-1">Usage <a class="header-anchor" href="#usage-1" aria-label="Permalink to “Usage”">​</a></h3><ol><li><strong>Set Store Key Name</strong>: Enter the key name that was used when storing the data with &quot;Set Local Data&quot;</li><li><strong>Wait for Data</strong>: Enable &quot;Wait until the given key data is received&quot; if the data might not be immediately available</li><li><strong>One-time Use</strong>: Enable &quot;Delete the data after getting the key data&quot; if you only need to use the data once</li></ol><h3 id="example-1" tabindex="-1">Example <a class="header-anchor" href="#example-1" aria-label="Permalink to “Example”">​</a></h3><ul><li><strong>Store Key Name</strong>: <code>CTH_EDF_DB_LOCAL_user_profile</code></li><li><strong>Wait until the given key data is received</strong>: ✅ Enabled</li><li><strong>Delete the data after getting the key data</strong>: ❌ Disabled (keep data for reuse)</li></ul><h3 id="technical-notes-1" tabindex="-1">Technical Notes <a class="header-anchor" href="#technical-notes-1" aria-label="Permalink to “Technical Notes”">​</a></h3><ul><li><strong>Storage API</strong>: Uses <code>chrome.storage.local</code> API (not <code>localStorage</code>)</li><li><strong>Asynchronous</strong>: Data retrieval is asynchronous</li><li><strong>Wait Option</strong>: When enabled, field waits until data becomes available</li><li><strong>Delete Option</strong>: Automatically removes data after retrieval when enabled</li></ul><hr><h2 id="remove-local-data" tabindex="-1">Remove Local Data <a class="header-anchor" href="#remove-local-data" aria-label="Permalink to “Remove Local Data”">​</a></h2><p>Delete data from the browser&#39;s extension storage (stored via <a href="#set-local-data">Set Local Data</a>) using the <code>chrome.storage.local</code> API and the <strong>unique key</strong> of that data.</p><table tabindex="0"><thead><tr><th>Options</th><th>Description</th></tr></thead><tbody><tr><td><strong>Store Key Name</strong></td><td>Enter the unique key name of the data you want to delete. Use prefix <code>CTH_EDF_DB_LOCAL_</code> for consistency.</td></tr></tbody></table><h3 id="usage-2" tabindex="-1">Usage <a class="header-anchor" href="#usage-2" aria-label="Permalink to “Usage”">​</a></h3><ol><li><strong>Set Store Key Name</strong>: Enter the exact key name that was used when storing the data with &quot;Set Local Data&quot;</li><li><strong>Remove Data</strong>: The data associated with that key will be permanently deleted from browser extension storage</li></ol><h3 id="example-2" tabindex="-1">Example <a class="header-anchor" href="#example-2" aria-label="Permalink to “Example”">​</a></h3><ul><li><strong>Store Key Name</strong>: <code>CTH_EDF_DB_LOCAL_user_profile</code></li><li><strong>Result</strong>: The user profile data will be permanently removed from browser extension storage</li></ul><h3 id="technical-notes-2" tabindex="-1">Technical Notes <a class="header-anchor" href="#technical-notes-2" aria-label="Permalink to “Technical Notes”">​</a></h3><ul><li><strong>Storage API</strong>: Uses <code>chrome.storage.local</code> API (not <code>localStorage</code>)</li><li><strong>Permanent Deletion</strong>: Data is permanently removed and cannot be recovered</li><li><strong>Immediate Effect</strong>: Deletion happens immediately</li></ul>',40))]))}});export{y as __pageData,v as default};
